import React from "react";
import {UserContext} from "../../App"

function ComponentF() {
    return (
        <div>
            <UserContext.Consumer>
                {
                    (username) => (
                        <h1>My name is {username}, and my email is ______.</h1>

                    )
                }
            </UserContext.Consumer>
            
        </div>
    )
}

export default ComponentF
